import React from "react";
import { Link } from "react-router-dom";
import "./Button.css";

function Button({ onClick, to}) {
  return (
    <Link className="button" onClick={onClick} to={to}>Giriş Yap</Link>
    // <button className="button" onClick={onClick}>
    //   Giriş Yap
    // </button>
  );
}

export default Button;
